import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
const nav = () => {
  const [isMobileMenuOpen, setMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => setMobileMenuOpen(!isMobileMenuOpen);

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <NavLink to="/" exact>
          BrandLogo
        </NavLink>
      </div>

      <button className="mobile-menu-toggle" onClick={toggleMobileMenu}>
        â˜° {/* Alternatively, use an icon from a library like FontAwesome */}
      </button>

      <ul class = "bg-blue-500 text-white" className={`navbar-links ${isMobileMenuOpen ? 'open' : ''}`}>
        <li><NavLink to="/" exact activeClassName="active">Home</NavLink></li>
        <li><NavLink to="/about" activeClassName="active">About</NavLink></li>
        <li><NavLink to="/portfolio" activeClassName="active">Services</NavLink></li>
        <li><NavLink to="/contact" activeClassName="active">Contact</NavLink></li>
      </ul>
    </nav>
  );
};

export default nav;
